contracts/base/Defs.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

contract Defs {

    // the protocol fee 
    uint PROTOCOL_FEE;

    // the fee address, for taking fees 
    address FEE_WALLET;

    // native token 
    address constant NATIVE_TOKEN = 0xEeeeeEeeeEeEeeEeEeEeeEEEeeeeEeeeeeeeEEeE;

    // adapters 
    bytes32 constant ROUTE_GROUP_UNI_V2 = bytes32("univ2");
    bytes32 constant ROUTE_GROUP_UNI_V3 = bytes32("univ3");

    // id  =>  RouteParams 
    mapping (bytes32 => RouteParams) public routes;
    bytes32[] public routesIds;

    struct RouteParams {
        bytes32             id;
        bytes32             group; //adapter name uni_v2, uni_v3 and 1inch, balancer
        address   payable   router;
        address             factory;
        address             weth;
        uint256             createdAt;
        bool                enabled; 
    }

    /**
     * @dev convert percentage in basis point of a value 
     * @param amount the amount to be calculated on
     * @param bps percentage value in basis point
     */
    function calPercentage(uint amount, uint bps) 
        public 
        pure 
        returns (uint256)
    {
        require((amount * bps) >= 10_000);
        return (amount * bps) / 10_000;
    }

}

contracts/base/TransferHelper.sol.content:
// SPDX-License-Identifier: GPL-2.0-or-later
pragma solidity ^0.8.0;

import "./Defs.sol";
import "@openzeppelin/contracts/interfaces/IERC20.sol";

contract TransferHelper is Defs {

    /**
     * @dev safeTransfer eth or token 
     * @param token, the token contract
     * @param from the sender's address 
     * @param to the recipient's address
     * @param value the value to send
    */
    function transferAsset(
        address token,
        address from,
        address to,
        uint256 value
    ) internal {

        if(token == NATIVE_TOKEN){
            safeTransferETH(to, value);
        } else {
            safeTransferFrom(token, from, to, value);
        }
    }

    function safeTransferFrom(
        address token,
        address from,
        address to,
        uint256 value
    ) internal {
        (bool success, bytes memory data) =
            token.call(abi.encodeWithSelector(IERC20.transferFrom.selector, from, to, value));
        require(success && (data.length == 0 || abi.decode(data, (bool))), 'BotFi#TransferHelper: TOKEN_TRANSFER_FAILED');
    }

    function safeTransferETH(address to, uint256 value) internal {
        (bool success, ) = to.call{value: value}(new bytes(0));
        require(success, 'BotFi#TransferHelper: ETH_TRANSFER_FAILED');
    }
}

